import React from "react";

class CitySearched extends React.Component
{
    constructor(props) {
        super(props);
        this.state = {cityName:  localStorage.getItem('city_name')};
        localStorage.removeItem('city_name');
    }

    render()
    {
        console.log(this.state.cityName);
        return(
            <div>
                <p>this is city searched page {this.state.cityName}</p>
            </div>
        )
    }
    
}

export default CitySearched;
